    "2016-06-23T07:23:57.795107",nt"name": "planning-department-records",nt"isopen":
    true,nt"url": null,nt"notes": "This dataset includes all cases reviewed
    by the Planning Department. Many cases are related to Building Permits. A Building
    Permit may produce a number of cases with the Planning Department, for example a
    single Building Permit may require a Transportation Study case and an Environmental
    Review case. Some cases are not related to Building Permits, e.g Variances or Conditional
    Use Authorizations. The type of case can be seen in the Record_Type field. Additional
    information can be found in the document attached to this dataset under About. It
    is important to note that older cases (prior to 1 January 1999) were not consistently
    recorded in this database. Should you wish to analyze trends within this data it
    is advisable to remove these older cases (those where the entry in the 'Date_Opened'
    field is older than 1 Jan, 1999). This dataset is updated nightly.rnrnNote: Includes
    Projects, Entitlements, Cases, Enforcement, Miscellaneous Permits, Zoning Administrator
